import React, { Component } from 'react';
import './App.css';
import icon from './covid_icon.png';

export class App extends Component {
  async componentDidMount() {
    const data = await fetch('api/home');
    console.log(data)
  }

  render() {
    return (
      <div style={{ display: 'flex', backgroundColor: '#fff', flexDirection: 'column' }}>
        <div style={{ display: 'flex', margin: 20, justifyContent: 'row', alignItems: 'center' }}>
          <img style={{ height: 45, marginRight: 20 }} src={icon}/>
          <p style={{ fontSize: 40}}>World Health Status - COVID-19 Epidemic</p>
        </div>


      </div>
    );
  }
}
